import styled from "styled-components";
import logo from '../images/logo.gif'
const Container = styled.div`
    background-color: black;
    
    display: flex;
`
const Header = () => {
    const [balance, setBalance] = useState(5000)
    return (
        <Container>
           <img src={logo} alt="" />
        </Container>
    )
}

export default Header;
